  description: "Ena loma ni vica na yabaki sa oti, a tabaki kina e dua na nodai vola ni lotu e dua na vosa vakatautauvata me baleta e dua na vanua lolobo vakarerevaki sara. Ena nodra lakova tiko na tamata na gaunisala e lako sivita tiko sa dauvakavuqa na nodra lutu tiko kina. Na nodra kaci ni vakaqara bula sa rawa ni rogoci mai vei ira kece na veikoro era voleka kina. Sa dua na ka na kena vakadomobula."
